import 'isomorphic-unfetch';
import Link from 'next/link'

const Products2 = (props) => {
  console.log(props.products)
  const { products} = props

  return (
    <div>
      Products
      <Link href="/products2/[id]" as="/products2/410-">
          <a> click </a>
      </Link>
      {
        products && products.map(product => <div key={product.id}>{product.id} - {product.name}</div>)
      }
    </div>
  )
}

Products2.getInitialProps = async function(){
  const res = await fetch('http://localhost:3000/api/products2')
  const productsData = await res.json()
  return {
    products: productsData
  }

}


export default Products2
